import React from 'react';


const IdentitySection = () => {
  return (
    <div className="form-row">
             <label for="name">
               Name
             </label>
             <input
               id="name"
               name="name"
               placeholder="Jenny Rosen"
               required             />
           </div>
  )
}

export default IdentitySection;
